import React, {Component} from 'react';
import {
    View,
    KeyboardAvoidingView,
    TextInput,
    StyleSheet,
    Text,
    Platform,
    TouchableWithoutFeedback,
    Button,
    Keyboard
} from 'react-native';
import MyButton from "./MyButton";

export default class extends Component {
    constructor() {
        super();
        this.state = {username: '', password: ''}
    }

    render() {
        return (
            <KeyboardAvoidingView behavior={Platform.OS === "ios" ? "padding" : "height"}>
                <TouchableWithoutFeedback onPress={Keyboard.dismiss}>
                    <View>
                        <Text>Username: </Text>
                        <TextInput placeholder="Username" onChangeText={(value) => this.setState({username: value})}
                                   value={this.state.username}/>
                    <Text>Password: </Text>
                    <TextInput placeholder="Password" onChangeText={(value) => this.setState({password: value})}
                               value={this.state.password}/>
                    <MyButton title={'Register'} action={'register'} values={this.state}/>
                </View>
            </TouchableWithoutFeedback>
    </KeyboardAvoidingView>
    )
        ;
    }
}
